import React from 'react';

import './header.css';
import logo from '../../images/logo-orange-final.png';

export default function Header() {
    return (
        <header>
            <div className='logo' style={{ backgroundImage: `url(${logo})` }}/>
            <nav>
                <ul>
                    <li>
                        Selected Work
                    </li>
                    <li>
                        About
                    </li>
                </ul>
            </nav>
            <div className='hire-me'>Hire me</div>
        </header>
    )
}
